import "./App.css";
import "./index.css";
import Movies from "./Movies";
import Show from "./Show";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/Movies" component={Movies} />
          <Route path="/Tv-Show" component={Show} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
